import projectimg1 from "../media/projectimg1.png";
import projectimg2 from "../media/projectimg2.png";
import projectimg3 from "../media/projectimg3.png";
import projectimg4 from "../media/projectimg4.png";
const projectdata=[
    {
        id:1,    
        title:"Zifcare",
        subtitle:<span>- designed <span className="colored_subtitle">Zifcare web</span>  and <span className="colored_subtitle">Zifcare app</span> </span>,
        img:projectimg1
    },
    {
        id:3,    
        title:"Personal Portfolio Design",
        subtitle:<span>- designed a <span className="colored_subtitle">Space</span>  theme portfolio</span>,
        img:projectimg3
    },
    {
        id:4,    
        title:"Ethernals HACKATHON 2022",
        subtitle:<span>- designed a <span className="colored_subtitle">decentralized youtube</span>  "nekomimi"</span>,
        img:projectimg4
    }

    ]


export default projectdata ;
